Identifikator licence, koji je globalno jedinstven identifikator za licencu ili ugovor pod kojim se artikli generiraju, podnose na obradu i/ili plaćaju, koji se sastoji od spajanja:
 - koda izdavateljske agencije ISO/IEC 15459;
 - broja licence ili ugovora koji se usklađuje sa specifikacijama dotične izdavateljske agencije;
 i koji:
 - sadrži samo velika slova abecede i/ili numeričke znakove;
 - je jedinstven (tj. razlikuje se od bilo kojeg drugog identifikatora sukladnog s ISO/IEC 15459) unutar domene izdavateljske agencije;
 - ne može se izvesti iz bilo kojeg drugog identifikatora sukladnog s ISO/IEC 15459, izdanog pod istom izdavateljskom agencijom, jednostavnim dodavanjem znakova na njegov kraj, ili njihovim uklanjanjem.

Kod područja ribolova FAO kako je definirano od strane Odjela za ribarstvo i akvakulturu FAO (http://www.fao.org. Pretraži za pod-stranicu Kod područja ribolova).
Dozvoljeni su svi znakovi definirani podskupom GS1 General Specification ISO/IEC 646.
