'26L' Kod lokacije, koji je kod koji identificira lokaciju ili geografsko područje, ili povezanu grupu takvih lokacija ili područja, koji ima relevantnost za povezanu transakciju i koji je usklađen s jednom od struktura definiranih u (a) do (f) ispod:
a) dva velika slova abecede koji odgovaraju ISO 3166-1 dvoslovnom alfa kodu zemlje u kojoj se nalaze, ili koja se sastoji od navedenih lokacija ili područja;
b) tri velika slova abecede koja odgovaraju IATA kodu zračne luke ili grada u, blizu, ili koja se sastoji od navedenih lokacija ili područja;
c) četiri ili više znakova od kojih prva tri odgovaraju ISO 3166-1 kodu zemlje slijedi crtica (-), s ostatkom koji predstavlja poštanski broj u dotičnoj zemlji;
d) četiri ili više znakova od kojih prva tri odgovaraju ISO 3166-1 kodu zemlje slijedi točka (.), s ostatkom koji predstavlja kod podjele zemlje ISO 3166-2 u dotičnoj zemlji;
e) pet velikih slova abecede koji odgovaraju UN/LOCODE kodu područja u, blizu, ili koja se sastoji od navedenih lokacija ili područja;
f) konkatenacija, dužine ne manje od sedam niti više od 35 znakova, koja se sastoji od:
- koda izdavateljske agencije ISO/IEC 15459;
- koda lokacije, koji se sastoji od znakova uzetih iz skupa {A-Z; 0-9} koji se usklađuje sa specifikacijama dotične izdavateljske agencije.

Lokacija događaja UN/LOCODE.
