Identifikator opreme, koji je globalno jedinstven identifikator za uređaj, stavku opreme ili instancu računalne aplikacije korištene u proizvodnji, transportu, obradi ili drugom rukovanju artiklima.

UPU lokacijski kod, kod koji identificira lokaciju ili geografsko područje, ili povezanu grupu takvih lokacija ili područja, koja su relevantna za povezanu transakciju i koji je u skladu s jednom od struktura definiranih u a) do g) ispod:
a) dva velika slova abecede koji odgovaraju ISO 3166-1 dvoslovnom kodu zemlje u kojoj se, ili od koje se sastoji, nalazi(lo) lokacija(e) ili područje(a);
b) tri velika slova abecede koji odgovaraju IATA kodu zračne luke ili grada u, blizu, ili od kojeg se sastoji, nalazi(lo) lokacija(e) ili područje(a);
c) četiri ili više znakova od kojih prva tri odgovaraju ISO 3166-1 kodu zemlje slijedi crtica (-), s ostatkom koji predstavlja poštanski broj u dotičnoj zemlji;
d) četiri ili više znakova od kojih prva tri odgovaraju ISO 3166-1 kodu zemlje slijedi točka (.), s ostatkom koji predstavlja ISO 3166-2 kod podjele zemlje u dotičnoj zemlji;
e) pet velikih slova abecede koji odgovaraju UN/LOCODE kodu područja u, blizu, ili od kojeg se sastoji, nalazi(lo) lokacija(e) ili područje(a);
f) šest velikih alfanumeričkih znakova koji odgovaraju UPU IMPC kodu dodijeljenom u skladu s UPU standardom S34;
g) spoj, koji nije kraći od sedam ni duži od 25 znakova, od:
 - koda izdavatelja dodijeljenog u skladu s UPU standardima S31;
 - lokacijskog koda, koji se sastoji od znakova iz skupa {A-Z; 0-9} koji odgovara specifikacijama izdavatelja.

Registarska pločica s podacima o usluzi i lokacijskim kodom je složena konstrukcija podataka, usklađena sa specifikacijom u UPU standardu S25, koja uključuje specifikaciju:
 - identifikatora stavke u skladu s ISO/IEC 15459;
 - specifikaciju usluge koja će se pružiti u vezi sa stavkom, identifikatora podataka 5U;
 - UPU lokacijski kod sukladan s identifikatorom podataka 17U ili kvalificirani UPU lokacijski kod sukladan s identifikatorom podataka 18U.
 Napomena - Za više detalja, molimo pogledajte UPU standard S25. Razlika između jednostavnog UPU lokacijskog koda (DI 17U) i kvalificiranog UPU lokacijskog koda (DI 18U) može se odrediti iz prvog znaka. Ako je ovaj numerički, primjenjuje se 18U; ako je abecedni, primjenjuje se 17U.

