Datum, predstavljen u modificiranom UTC sukladnom obliku:
yyyy[mm[dd[hh[mm[ss[fff]]]]]][poooo] gdje uglate zagrade označavaju opcionalnost, yyyy je godina, mmdd mjesec i dan, hhmmss vrijeme dana u satima minutama i sekundama, fff frakcije sekundi, a poooo pomak od UTC-a izražen u satima i minutama, pomak je pozitivan ako je p točka (.), negativan ako P je minus (-).
PRIMJER:
2005 - (UTC) kalendarska godina 2005;
200505 - (UTC) kalendarski mjesec svibanj 2005;
20050518 - (UTC) 18. svibnja 2005;
200505181247 - 12:47 UTC 18. svibnja 2005;
200505181247.0100 - 12:47 lokalno vrijeme, što je 11:47 UTC, 18. svibnja 2005;
20050518124723099 - 99 milisekundi nakon 12:47:23 UTC 18. svibnja 2005.

Kvalificirani datum, koji se sastoji od spoja:
- koda izdavatelja prema ISO/IEC 15459;
- kvalifikatora datuma koji se usklađuje sa specifikacijama tog izdavatelja;
- datuma čiji format i tumačenje su u skladu sa specifikacijama izdavatelja za taj kvalifikator datuma.

Deklaracija o kategoriji materijala ambalaže*, Kod* i Težini za određeni materijal ambalaže korišten u određenoj ambalaži prema direktivi EU o ambalaži i otpadu od ambalaže. (Kategorija materijala i kod definirani u Dodatku M).
12ECCMMMMMMNNNNNUU gdje: - '12E' (an3) je Identifikator podataka;
 - 'CC' (n2) je Kategorija materijala prema Dodatku M;
 - 'MMMMMM' (an1...6) je Kod materijala prema Dodatku M;
 - 'NNNNN' (n5) Težina materijala, uključujući decimalnu točku (npr., 12.12);
 - 'UU' (an2) je Jedinica mjere za težinu (npr., KG, GR, LB ili OZ prema ANSI X12.3 kao u Dodatku D).

Ime stranke.
Ime stranke slijedi plus (+) znak nakon čega slijedi jedna ili više vrijednosti kodova iz EDIFACT popisa kodova 3035 'Kvalifikator stranke', npr.;
BY [Kupac];
CF [Operator kontejnera];
CN [Primatelj];
CS [Konsolidator];
DEI [Operator plovila/kapetan plovila];
FA [Kod operativnog osoblja];
IM [Uvoznik];
MF [Proizvođač];
OS [Otpremnik];
SE [Prodavač];
ST [Dostava na];
UC [Krajnji primatelj].

Broj primatelja.
Jedinstveni identifikacijski broj može biti IRS, EIN, SSN ili broj dodijeljen od strane CBP-a, kako je potrebno na Sigurnosnom podnošenju. Samo sljedeći formati se smiju koristiti: IRS EIN: NN-NNNNNNN;
IRS EIN s sufiksom:
NN-NNNNNNNXX;
SSN: NNN-NN-NNNN;
CBP dodijeljeni br.: YYDDPP-NNNNN.
